/**
 * 页面名_模块名_类型名
 */
const comState = {
    labelPage: (action) => {
        return {
            default: 0,
            type: 'handleLabelPage',
            data: {
                labelPage: Number(action?action.labelPage:0)
            }
        }
    }
}

export default comState;
